import React from 'react';
import './App.css';
import 'antd/dist/antd.css';

import CustomLayout from './components/Layout';


function App() {
  return (
    <div className="App">
      <CustomLayout>
        <ExpenseList/>
      </CustomLayout>
    </div>
  );
}

export default App;
